create table t_bike_warn
(
    id           BIGINT(19) auto_increment
        primary key,
    bike_barcode VARCHAR(255) null comment '车辆条码',
    lock_barcode VARCHAR(255) null comment '智能锁条码',
    dept_id      BIGINT(19)   null,
    message      VARCHAR(255) null,
    longitude    VARCHAR(100) null comment '经度',
    latitude     VARCHAR(255) null comment '纬度',
    time         BIGINT(19)   null comment '发送时间'
)
    charset = utf8mb4;

